import React from 'react';
import PlanetCard from './PlanetCard'

const Content = ({planets}) => {
    return (
        planets.map((planet) => {
            [name, climate, gravity, terrain] = { planet };
            <Card 
                key={name}
                name={name}
                climate={climate}
                gravity={gravity}
                terrain={terrain}
            />
        })
    );
}

export default Content;
